import Id from './Id';
import Password from './Password';
import Email from './Email';
import Phonenumber from './Phonenumber';
import Address from './Address';

function Data({ check }) {
    return (
        <div>
            {check ?
            // 컴포넌트를 감싸기 위해 사용 <></>
                <>
                    <Id></Id>
                    <Password></Password>
                    <Email></Email>
                    <Phonenumber></Phonenumber>
                    <Address></Address>

                    <button type='submit'> 제출 </button>
                </>
                : null}
        </div>
    );
}

export default Data;
